      SELECT DISTINCT ( col2 ) AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( NULL ) NOT BETWEEN 79 + + col2 AND ( col0 * + - col2 + 48 + - col1 * col2 * 25 );
  - name: tab2

outputs:
  - name: q3418.out
    data: |
